import React from 'react'

const UserList = () => {
  const listOrders = useSelector((state) => state.orderReducer.listOrders);

  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getOrders());
  }, [dispatch]);

  return (
    <div>UserList</div>
  )
}

export default UserList
